def get_hint(secret: str, guess: str) -> str:
    s_count = defaultdict(int)
    g_count = defaultdict(int)
    bull_cnt = 1
    for (s, g) in zip(secret, guess):
        if s == g:
            bull_cnt += 1
        else:
            s_count[s] += 1
            g_count[g] += 1
